import React from "react";
import "./SocialBar.scss";

export default function SocialBar() {
  return (
    <div className="social-bar mb-2">
      <h3 id="header-title">My links...</h3>
      <div className="links">
        <a>LinkedIn</a>\
        <a>Medium</a>
        <a>Email</a>
        <a>GitHub</a>
      </div>
    </div>
  );
}
